    18,nt"tags": [],nt"title": "Dissolved inorganic carbon, pH, alkalinity,
    temperature, salinity and other variables collected from discrete sample and profile
    observations using Alkalinity titrator, CTD and other instruments from the HUDSON
    in the Davis Strait, Labrador Sea and North Atlantic Ocean from 2010-05-13 to 2010-05-30
    (NODC Accession 0108225)",nt"tracking_summary": {ntt"total": 1,ntt"recent":
    1nt},nt"groups": [],nt"relationships_as_subject": [],nt"revision_timestamp":
    "2015-09-26T21:27:08.689911",nt"name": "dissolved-inorganic-carbon-ph-alkalinity-temperature-salinity-and-other-variables-collected-fro02b4b",nt"isopen":
    false,nt"url": null,nt"notes": "NODC Accession 0108225 includes chemical,
    discrete sample, physical and profile data collected from HUDSON in the Davis Strait,
    Labrador Sea and North Atlantic Ocean from 2010-05-13 to 2010-05-30 and retrieved
    during cruise 18HU20100513 (HUD2010-014). These data include ALKALINITY, AMMONIUM,
    CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-113 (CFC-113), CHLOROFLUOROCARBON-12
    (CFC-12), Carbon tetrachloride (CCL4), DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN,
    HYDROSTATIC PRESSURE, NITRATE, NITRATE + NITRITE CONTENT (CONCENTRATION), PHOSPHATE,
    Potential temperature (theta), SALINITY, SILICATE, WATER TEMPERATURE, methyl chloroform
    (MC) and pH. The instruments used to collect these data include Alkalinity titrator,
    CTD, Coulometer for DIC measurement and bottle. These data were collected by Kumiko
    Azetsu-Scott and Glen Harrison of Bedford Institute of Oceanography as part of the
    CLIVAR_AR07W_2010 data set.nnThe International CLIVAR Global Ocean Carbon and Repeat
    Hydrography Program carries out a systematic and global re-occupation of select
    WOCE/JGOFS hydrographic sections to quantify changes in storage and transport of
